RPM Disc Golf starter pack is ideal for beginners to advanced and will get you out and throwing a variety of shots in no time.

This standard set includes RPM Strata plastic.  In this set you will receive three discs;

Driver:  PEKAPEKA or HUIA or TARA ITIMid-Range:  KOTUKU or PIWAKAWAKAPutter:   TAKAPU or RURU or TUIColours may vary from display image, note also, this is a generic image - the actual discs may not be the same as in the image.  The variations will indicate the combination of discs in each set, however colours vary from set to set.

